  const api = ProjectService();

  useEffect(() =>{
    api.getAll().then(res => {
      console.log(res)
      setProjects(res.data);
     }).catch(error => console.log(error))
  },[])


     console.log('projects',projects)

  return (
    <>
      <Layout>

        <div className = 'portfolio-page-container'>

